import React from 'react';

const Rank = ({name,entries}) => {
	return (
		<div>
			<div className='white f3'>
				{`${name},number of entries is`}
			</div>
			<div className='white f1'>
				{entries}
			</div>
		</div>
		);
}

export default Rank;

